import React, { useState, } from 'react';
import { createProfile } from '../api';
import { readProfile } from '../api';


function CreateProfileForm() {
  const [formData, setFormData] = useState({
    type: '',
    name: '',
    email: '',
    address: '',
    contact: '',
    website: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
